import React from "react";
import { FooterBase } from "./styles";
import { FaFacebook, FaInstagram, FaLinkedin } from 'react-icons/fa'

function Footer() {
  return (
    <FooterBase>
      <ul className="">
        <li>
          <FaFacebook />
        </li>
        <li>
          <FaInstagram />
        </li>
        <li>
          <FaLinkedin />
        </li>
      </ul>
      <p className="">
        <span>IFSULDEMINAS</span> &copy; 2022
      </p>
    </FooterBase>
  );
}
export default Footer;
